function makeTestVisuals() {
	var visuals = [];
	var gt = globalTime();
	var kenny = makeKenny();
	for(var i in kenny) {
		visuals.push(makeTestVisual(kenny[i], gt));
	}
	return visuals;
}

function makeTestVisual(input, time) {
	var property = new VisualProperty(input.properties.color, input.properties.width);
	var dummy = new StrokeVisual(time, property);
	var vertices = [];
	for(var i in input.vertices) {
		var vert = input.vertices[i];
		vertices.push(new Vertex(vert.x, vert.y, time));
	}
	dummy.setVertices(vertices);
	return dummy;
}

